import React from "react";
import styled from "styled-components";

const ExampleText = styled.p`
    font-size: 50px;
  font-weight: 200;
  text-align: center;
  margin-top: 200px;
`
const ExampleContent = styled.p`
    font-size: 25px;
  font-weight: 100;
  text-align: center;
  margin-top: -30px;
  line-height: 40px;
`
const ExampleButton1 = styled.div`
    width: 207px;
  height: 50px;
  border-radius:5px;
  background-color:#007bff;
  margin-left: 750px;
`
const ButtonText1 = styled.p`
    color: white;
    font-size: 21px;
  font-weight: 500;
  position:absolute;
  margin-top: 10px;
  margin-left: 17px;
`
const ExampleButton2 = styled.div`
    width: 207px;
  height: 50px;
  border-radius:5px;
  background-color:#6c757d;
  margin-left: 963px;
  margin-top: -50px;
`
const ButtonText2 = styled.p`
    color: white;
    font-size: 21px;
  font-weight: 500;
  position:absolute;
  margin-top: 10px;
  margin-left: 18px;
`
const Box = styled.div`
    display:inline-block;
    flex-direction: row;
`
const TopBar= styled.div`
    width: 100%;
    height: 70px;
    background-color: #343a40;
    margin-top: -100px;
`


const Example = (props) =>{
    return(
        <>
        <TopBar>

        </TopBar>
        <ExampleText>{props.exampleText}</ExampleText>
        <ExampleContent>Something short and leading
        about the collection below—its contents, <br/> the creator, etc. 
        Make it short and sweet, but not too short so folks don’t<br/> simply skip over it entirely.</ExampleContent>
        <Box>
            <ExampleButton1>
            <ButtonText1>Main call to action</ButtonText1>
            </ExampleButton1>
        <ExampleButton2>
            <ButtonText2>Secondary action</ButtonText2>
            </ExampleButton2>
        </Box>
        </>
    )
}

export default Example;
